import React from 'react';


const List = ({ onRouteChange, loadCategory }) => {
    return(
        <div>
                            <div className='tc bg-light-green dib br3 pa3 ma2 grow bw2 shadow-5'>
                                <div>
                                <div>
                                    <h2 onClick={() => {onRouteChange('infos'); loadCategory('Ramen');}}
                                        className='f3 link dim black underline pa3 pointer'>Ramen</h2>
                                </div>
                                <div>
                                    <h2 onClick={() => {onRouteChange('infos'); loadCategory('Cafe');}}
                                        className='f3 link dim black underline pa3 pointer'>Cafe</h2>
                                </div>
                                <div>
                                    <h2 onClick={() => {onRouteChange('infos'); loadCategory('View');}}
                                        className='f3 link dim black underline pa3 pointer'>View</h2>
                                </div>
                                <div>
                                    <h2 onClick={() => {onRouteChange('infos'); loadCategory('cafe');}}
                                        className='f3 link dim black underline pa3 pointer'>cafe</h2>
                                </div>
                                <div>
                                    <h2 onClick={() => {onRouteChange('infos'); loadCategory('Shopping');}}
                                        className='f3 link dim black underline pa3 pointer'>Shopping</h2>
                                </div>
                                <div>
                                    <h2 onClick={() => {onRouteChange('infos'); loadCategory('Place to study');}}
                                        className='f3 link dim black underline pa3 pointer'>Place to study</h2>
                                </div>
                                <div>
                                    <h2 onClick={() => {onRouteChange('infos'); loadCategory('Izakaya');}}
                                        className='f3 link dim black underline pa3 pointer'>Izakaya</h2>
                                </div>
                                <div>
                                    <h2 onClick={() => {onRouteChange('infos'); loadCategory('Japanese food');}}
                                        className='f3 link dim black underline pa3 pointer'>Japanese food</h2>
                                </div>
                                </div>
                            </div>
        </div>
    );
}

export default List;
